import React from 'react';
import Header from '../Components/header';
import Login from '../Components/login';
import Section from '../Components/section';
import ArticleEspecificaciones from '../Components/articleEspecificaciones';
import EspecificacionesCompletas from '../Components/especificacionesCompletas';


export default function IngresoEspecificacionesCompletas(){
  return(
    <>
    <Header />
    <Login />
    <Section />
    <ArticleEspecificaciones />
    <EspecificacionesCompletas />
    </>
);
}
